import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and interact with main search input
    await page.waitForSelector('#mainSearchInput', { timeout: 5000 });
    await page.click('#mainSearchInput');

    // Wait for search modal input to appear
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'jun');

    // Take screenshot after search input
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_jun.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_jun.png'));

    // Wait for a search result with username 'jun'
    await page.waitForSelector('.search-item .username', { timeout: 5000 });
    // Click on the first user result with username 'jun'
    const userJun = await page.$(`xpath=//div[contains(@class,"search-item")]//span[@class="username" and text()="jun"]`);
    if (userJun) {
      await userJun.click();
    }

    // Wait for and click the first "Follow" button in suggestions
    await page.waitForSelector('.follow-btn', { timeout: 5000 });
    const followBtns = await page.$$('.follow-btn');
    if (followBtns.length > 0) {
      await followBtns[0].click();
    }

    // Take screenshot after following
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_follow_jun.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_follow_jun.png'));

    // Interact with "Create" button in nav
    await page.waitForSelector('.create-btn', { timeout: 5000 });
    await page.click('.create-btn');

    // Wait for file input for post
    await page.waitForSelector('#fileInput', { timeout: 5000 });

    // Upload a dummy file (simulate file selection)
    // We'll create a Buffer for a small PNG image
    const dummyImage = Buffer.from(
      'iVBORw0KGgoAAAANSUhEUgAAAAEAAAABCAQAAAC1HAwCAAAAC0lEQVR42mP8Xw8AAn0B9S7gToQAAAAASUVORK5CYII=',
      'base64'
    );
    const fileChooserPromise = page.waitForEvent('filechooser', { timeout: 5000 });
    await page.click('.select-computer-btn');
    const fileChooser = await fileChooserPromise;
    await fileChooser.setFiles({
      name: 'dummy.png',
      mimeType: 'image/png',
      buffer: dummyImage
    });

    // Wait for the caption textarea to appear
    await page.waitForSelector('#postCaption', { timeout: 5000 });
    await page.fill('#postCaption', 'This is an automated test post! #automation');

    // Take screenshot after filling caption
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_post_caption.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_post_caption.png'));

    // Click the Share button to publish the post
    // Try to find the Share button inside the modal
    const shareBtn = await page.$('button:has-text("Share")');
    if (shareBtn) {
      await shareBtn.click();
    }

    // Wait for post modal to close (modal disappears)
    await page.waitForSelector('.modal[style*="display: block"]', { state: 'detached', timeout: 5000 });

    // Take screenshot after post is shared
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_post_shared.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_post_shared.png'));

    // Extract data: check if the new post appears at the top of feed
    await page.waitForSelector('.posts .post', { timeout: 5000 });
    const firstPostCaption = await page.$eval('.posts .post .caption-text', el => el.textContent.trim());
    const firstPostUsername = await page.$eval('.posts .post .post-username', el => el.textContent.trim());

    // Interact with the first post: like it
    const firstLikeBtn = await page.$('.posts .post .like-btn');
    if (firstLikeBtn) {
      await firstLikeBtn.click();
    }

    // Take screenshot after liking
    await page.screenshot({ path: path.join(screenshotsDir, 'step_6_like_post.png') });
    screenshots.push(path.join(screenshotsDir, 'step_6_like_post.png'));

    // Click comment icon on first post
    const commentBtn = await page.$('.posts .post .action-btn >> nth=1');
    if (commentBtn) {
      await commentBtn.click();
    }

    // Wait for comment input in modal
    await page.waitForSelector('#commentInput', { timeout: 5000 });
    await page.fill('#commentInput', 'Nice post! #playwright');
    await page.waitForSelector('#postCommentBtn:not([disabled])', { timeout: 5000 });
    await page.click('#postCommentBtn');

    // Take screenshot after posting comment
    await page.screenshot({ path: path.join(screenshotsDir, 'step_7_comment_posted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_7_comment_posted.png'));

    // Extract comments from modal
    const comments = await page.$$eval('.comment-item .comment-text', els => els.map(e => e.textContent.trim()));

    return {
      success: true,
      action: "Searched for user 'jun', followed, created a post, liked and commented on the new post.",
      extractedData: {
        firstPostUsername,
        firstPostCaption,
        comments
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
